 Bubble sort is a simple sorting algorithm that works by repeatedly swapping elements in an array if they are in the wrong position. Here's an example implementation of bubble sort in Python:
```python
def bubble_sort(arr):
    n = len(arr)

    # repeat until no swapping is done this time
    for i in range(n - 1):
        # swap if elements are out of place
        for j in range(n - i - 1):
            if arr[j] > arr[j + 1]:
                arr[j], arr[j + 1] = arr[j + 1], arr[j]
```
