 Conway's Game of Life is a cellular automaton created by mathematician John Horton Conway in 1970. The Game of Life is a grid of cells with two states: "alive" and "dead". Each cell interacts with its neighboring cells according to a few simple rules:

* Any live cell with two or three live neighbors survives to the next generation.
* Any dead cell with exactly three live neighbors becomes a live cell.
* All other live cells die in the next generation. Similarly, all other dead cells stay dead.

